import React from "react";
import PointerIcon from "../images/pointerIcon.png";

export default function TravelCard(props) {
  return (
    <div className="travel--container">
      <img src={props.item.imageUrl} className="travel--image" />

      <div className="travel--location-container">
        <img src={PointerIcon} className="pointer-icon" />
        <p>{props.item.location}</p>
        <a
          href={props.item.googleMapsUrl}
          target="_blank"
          className="googleMaps"
        >
          View on Google Maps
        </a>
      </div>
      <div className="travel--discritpion-container">
        <h3>{props.item.title}</h3>
        <p>
          {props.item.startDate} - {props.item.endDate}
        </p>
        <p>{props.item.description}</p>
      </div>
      <hr />
    </div>
  );
}
